import React from 'react';
import TodoItem from './TodoItem';

const TodoList = () => {

  return (
    <div>
      <h2>Todo List</h2>
      {todoItems.map((item, index) => (
        <TodoItem
          key={index}
          description={item.description}
          deadline={item.deadline}
        />
      ))}
    </div>
  );
};

export default TodoList;
